import React from "react";
import styles from "./Card.module.css";


const Card= (props)=>{
    return(
        <div className={styles.contenedor}>
            <div> 
             <h2 className="titulo">{props.todo.titulo} </h2>
           </div>

           <div> 
              <h2>{props.todo.responsable}</h2>
           </div>

           <div> 
             <p>{props.todo.descripcion}</p>
           </div>
           
           <div> 
             <h2>{props.todo.prioridad}</h2>
           </div>

        </div>
    )
}
export default Card;
